class UserGreeting extends Component {
    
    constructor(props) {
        super(props)
    
        this.state = {
             isLoggedin: false
        }
    }
    
    
    render() {
        return (
            <div>
                <div>
                    Welcome Sawyer
                </div>
                <div>
                    Welcome Guest
                </div>
            </div>
        )
    }
}

export default UserGreeting
